export const AccountContext = createContext(null);

const AccountProvider = () => {
  const [account, setAccount] = useState();

  console.log(account);

  return (
    <AccountProvider
      value={{
        account,
        setAccount,
      }}
    >
      {Children}
    </AccountProvider>
  );
};

export default AccountProvider;
